import Link from "next/link";
import Typography from "@material-ui/core/Typography";

export default function Sections() {
  return (
    <div className="wrapper">
      <Link href="/sale">
        <a className="item">
          <Typography className="link">Sale</Typography>
        </a>
      </Link>
      <Link href="/sympathy">
        <a className="item">
          <Typography className="link">Sympathy</Typography>
        </a>
      </Link>
      <Link href="/gifts">
        <a className="item">
          <Typography className="link">Gifts</Typography>
        </a>
      </Link>
      <Link href="/plants">
        <a className="item">
          <Typography className="link">Plants</Typography>
        </a>
      </Link>
      <Link href="/birthday">
        <a className="item">
          <Typography className="link">Birthday</Typography>
        </a>
      </Link>
      <Link href="/samedaydelivery">
        <a className="item">
          <Typography className="link">Same Day Delivery</Typography>
        </a>
      </Link>
      <style jsx>{`
        .wrapper {
            display: flex;
            align-items: center;
            flex-wrap: nowrap;
            height: 100%;
        },
        .item {
            flex-grow: 1;
            text-decoration: none;
            font-weight: 400;
        },
        
        .link {
            color: #8e7329;
            text-align: center;
            text-decoration: none
        },

        .link::hover {
            cursor: pointer;           
            text-decoration: underline
        }
      `}</style>
    </div>
  );
}
